import React from 'react';

import {TextField} from '@material-ui/core'




const Search = () => {

  const getLocation = (e) =>{
    console.warn(e.target.value)
  }


   return (<div> 
    <TextField
    label="Enter Location"
   onChange={getLocation}
    />
    </div>  );
}
 
export default Search;
